column8:
CATZ(キャズ)のノウハウを結集し、さらに進化を遂げた次世代型フォグランプ『CATZ LED FOG (LEDフォグ)TYPE1 forトヨタ86/スバルBRZキット』。<BR>
人気のトヨタ86(ハチロク)/スバルBRZのフォグランプ標準装着車をはじめ、多くの車種(※1)の純正フォグランプと同形状なので簡単に取り付けできます。<BR>
LEDならではの鋭い白色の光が、86(ハチロク)/BRZのフロントをさらにシャープに変身させます。<BR>
<BR>
■最新欧州規格ECE規格( R19-03 Class F3)取得
<BR>
LEDを光源としたECE規格(R19-03 Class F3)を取得。もちろん保安基準適合。<BR>
<BR>
■省電力・長寿命<BR>
12V6.6Wハロゲン・HIDの約1/5の省電力。HID以上の長寿命を実現。<BR>
<BR>
■装着性の向上<BR>
純正フォグランプと同形状なので、そのまま交換可能、しかも電源は純正フォグランプコネクターへ接続するだけの簡単取り付け。<BR>
<BR>
■最適な視認性<BR>
専用設計のマルチリフレクターと日亜製LED素子2個を配することでフォグランプとして最適な配光パターンを実現。ハロゲンバルブとは質の違う、3000カンデラの明るさと6000Kの鋭い白色光です。<BR>
<BR></Center>
（※1）CATZ LED FOG TYPE1<BR>
装着可能車種例（フォグランプ標準装着車）<BR>
<BR>
CATZ LED FOG TYPE1 for トヨタ86/スバルBRZキット 装着可能車種（フォグランプ標準装着車）<BR>
