CATZ（キャズ）のノウハウを結集した次世代型フォグランプ『CATZ LEDフォグランプキット』。コンパクトなボディにプロジェクターとマルチリフレクターを配し、それぞれに高輝度LEDを採用。<br> 
トヨタ アクア/プリウスのフォグランプ標準装着車をはじめ、多くのトヨタ車（※１）のフォグランプ用としてご利用いただけ、取り付けも簡単です。<br>
<br>
■鋭い白色光、かつ省電力<br>
最先端の高輝度LEDを採用することにより、ハロゲンバルブとは質の違う5700Kの鋭い白色光を実現。さらに12V16Wでハロゲン/HIDの約1/2の省電力設計かつ、長寿命です。<br><br>
■フォグランプに最適な配向<br>
コンパクトなボディにプロジェクターとマルチリフレクターを配し、それぞれに高輝度LEDを採用。これによりフォグランプとして最適な配光パターンを実現しました。<br><br>

■簡単取り付け<br>
トヨタ プリウス（ZVW30）他、多くのトヨタ車（※１）の純正フォグランプ（※２）と同形状なので、そのまま純正フォグランプと交換するだけ。しかも電源は純正フォグランプコネクターへ接続するだけなので簡単取り付けできます。
<br><br>
■最新欧州規格ECE規格（ R19-03 Class F3）取得
LEDを光源としたECE規格（R19-03 Class F3）を取得。 
<BR>
<BR>
（※１）CATZ LED FOG　ランプキット　装着可能車種例（フォグランプ標準装着車）<br>
【車種】<br>
